INSERT INTO PARAMETROS (NOMBRE_PARAMETRO,VALOR_PARAMETRO) VALUES ('LEGAL_FACTURA','Todas las reparaciones o instalaciones efectuadas quedarán garantizadas por un período de tres meses o 2.000 kilómetros recorridos.La garantía se entiende total, incluyendo mano de obra, piezas sustituidas, servicio de grúa, desplazamiento de operarios e impuestos, y su cumplimiento se realizará sin que quepa postergación.La manipulación por terceros de las piezas garantizadas puede invalidar la garantía.Averiado el automóvil en garantía a más de 25 kilómetros del taller garante, deberá el cliente ponerse en contacto con éste para que proceda al cumplimiento de la garantía directamente o a través de terceros. A tales efectos, el aviso se realizará mediante cualquier medio que permita tener constancia de su recepción por el taller reparador. Si el taller garante no contestase a su requerimiento o se negase al cumplimiento de sus obligaciones, podrá el cliente realizar la reparación en cualquier otro establecimiento de entre los que se encuentren próximos, quedando el garante obligado al pago de la factura.')
